import React from 'react';
import './App.css';
import IncrementalSearch from "./components/IncrementalSearch";

export default class App extends React.Component {
  render() {
    return (
      <div style={{ position: 'relative' }}>
        <IncrementalSearch  option = 'Japan' />
      </div>
    );
  }
}
